import React from 'react';
import { Container, Typography, Button, Box, TextField } from '@mui/material';

function LoginSignup() {
  return (
    <Container maxWidth="md" sx={{ paddingY: 5 }}>
      <Box
        sx={{
          backgroundColor: '#eaeaea',
          padding: 4,
          borderRadius: 2,
          boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
          textAlign: 'center',
        }}
      >
        <Typography variant="h4" sx={{ color: '#1a374d', fontWeight: 'bold', marginBottom: 3 }}>
          Get Started Today
        </Typography>
        <Typography variant="body1" sx={{ color: '#4e4c49', marginBottom: 4 }}>
          Log in or create an account to join the most exciting fishing tournaments online.
        </Typography>
        <Box
          component="form"
          sx={{
            display: 'flex',
            flexDirection: 'column',
            gap: 2,
          }}
        >
          <TextField
            label="Email"
            variant="outlined"
            fullWidth
            sx={{
              backgroundColor: '#ffffff',
              borderColor: '#adb5bd',
            }}
          />
          <TextField
            label="Password"
            variant="outlined"
            type="password"
            fullWidth
            sx={{
              backgroundColor: '#ffffff',
              borderColor: '#adb5bd',
            }}
          />
          <Button
            variant="contained"
            size="large"
            sx={{
              backgroundColor: '#2d6a4f',
              color: '#eaeaea',
              '&:hover': { backgroundColor: '#4e4c49', color: '#eaeaea' },
            }}
          >
            Log In
          </Button>
        </Box>
        <Typography variant="body2" sx={{ color: '#4e4c49', marginTop: 4 }}>
          Don't have an account?{' '}
          <Button
            href="#signup"
            sx={{
              color: '#2d6a4f',
              textTransform: 'none',
              '&:hover': { color: '#4e4c49' },
            }}
          >
            Create one now
          </Button>
        </Typography>
      </Box>
    </Container>
  );
}

export default LoginSignup;
